Incêndio acontece em uma empresa às margens da BR-101, no Litoral Norte de Santa Catarina.Um incêndio de enormes proporções acontece às margens da BR-101 na manhã desta terça-feira (20), entre os municípios de Penha e Navegantes em Santa Catarina.

As chamas tiveram início em uma empresa transportadora e, de acordo com socorristas, a fumaça gerada pelo incêndio é tóxica. A pista da BR-101 foi interditada nos dois sentidos.
